import React from "react";
import "./App.css";
import Postuler from "./components/dashboardAide/postuler-aide";
import Accueil from "./components/accueil";
import ListeReservationAide from "./components/dashboardAide/liste-reservation-aide";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Connexion } from "./components/connexion-navbar";

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route exact path="/">
              <Accueil />
            </Route>
            <Route path="/aides">
              <Postuler />
            </Route>
            <Route path="/liste">
              <ListeReservationAide />
            </Route>
            <Route path="/login">
              <Connexion />
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
